import React from "react";
import {Title} from './Title';
import styled, { css } from 'styled-components';
import {VantaggiNoleggio} from './vantaggi_noleggio';

const Container = styled.div`
    font-family: Calibri, Candara, Segoe, "Segoe UI", Optima, Arial, sans-serif;
    @media only all and (max-width: 1440px) {
        max-width: 100%!important;
        flex: 0 0 100%!important;
    }
`;
const RedRectangle = styled.div`
    height: 264px;
    background: #8D120C;
    box-shadow: 0px 4px 4px rgba(0, 0, 0, 0.25);
    border-radius: 20px;
    position: relative;
`;
const RedTitle = styled.div`
    font-family: Poppins;
    font-style: normal;
    font-weight: bold;
    font-size: 48px;
    text-transform: uppercase;
    color: #FFFFFF;
    padding-top: 60px;
`;
const RedText = styled.div`
    font-family: Poppins;
    font-style: normal;
    font-weight: bold;
    font-size: 40px;
    text-transform: uppercase;
    color: #FFFFFF;
    padding-top: 40px;
`;
const Logo = styled.img`
    position: absolute;
    right: -1.5%;
    top: -35%;
`;
const BlackSquare = styled.div`
    height: 601px;
    background: #1D1D1B;
    border-radius: 20px;
`;
const BlackText = styled.div`
    font-weight: bold;
    font-size: 34px;
    line-height: 41px;
    text-transform: uppercase;
    color: #FFFFFF;
`;
function Vendo_compro_auto() {
    return(
        <>
        <Title/>
        <Container className="col-sm-8 mx-auto text-center"> 
        <img src="./images/mult_car.png"></img>
        <RedRectangle> 
            <Logo src="./images/logo4.svg"></Logo>
            <RedTitle>
                Perchè vendere la tua auto a noi?
            </RedTitle>
            <RedText>
                Perchè conviene!
            </RedText>
        </RedRectangle>
        <BlackSquare>
            <BlackText>Pagamento immediato</BlackText>
            <BlackText>Passaggio di proprieta immediato</BlackText>
            <BlackText>Valore quotazione dichiarata da Quatroruote</BlackText>
            <BlackText>Garanzia di sicurezza e PROFESSIONALITÀ</BlackText>
        </BlackSquare>
        </Container>
        <VantaggiNoleggio/>
        </>
    );
}
export {Vendo_compro_auto};
